import React from 'react'
import Logo from '../img/HackUMBC.Logo.Gold-2.png'

class WindowWidth extends React.Component {
  constructor() {
    super();
    this.state = { 
      height: window.innerHeight, 
      width: window.innerWidth
    };
    this.updateDimensions = this.updateDimensions.bind(this);
  }
  componentDidMount() {
    console.log(this.state.height);
    // Additionally I could have just used an arrow function for the binding `this` to the component...
    window.addEventListener("resize", this.updateDimensions);
  }
  updateDimensions() {
    this.setState({
      height: window.innerHeight, 
      width: window.innerWidth
    });
  }
  render() {
    return (
      <h3>
        {this.state.width}
      </h3>
    );
  }
  componentWillUnmount() {
    window.removeEventListener("resize", this.updateDimensions);
  }
}

function changeBurger(x) {
  var burger = document.getElementById("burger");
  if (x.classList.contains("change"))
    x.classList.remove("change");
  else
    x.classList.add("change");
}

function Tab(props) {
	return(
		<a id={props.id}
		   className="navbar-brand"
		   href={props.href}>
		   {props.name}
		</a>
	);
}

function LogoTab(props) {
	return(
		<a id="logo" class="navbar-brand" href="#top">
			<img
				src={Logo}
				height="50"
				width="50"
			/>
		</a>
	);
}

class Navbar extends React.Component {

	renderTab(n,i,h) {
		return(
			<Tab
				name={n}
				id={i}
				href={h}
			/>
		);
	}

	getWidth(props) {
		if (props.width > 800) {
			return(0);
		}
		else {
			return(1);
		}
	}

	render() {
		if (window.innerWidth > 800) {
			return(
				<navbar class="navbar fixed-top navbar-dark">
					<div class="wrapper">
						{this.renderTab("about","aboutTab","#about")}
						{this.renderTab("faq","faqTab","#faq")}
			        </div>
			        <LogoTab />
			        <div class="wrapper">
			          {this.renderTab("sponsors","sponsorsTab","#sponsors")}
			          {this.renderTab("social media","social-madiaTab","#footer")}
			        </div>
			        <a id="burger"> <i className="fa fa-bars"></i> </a>
		        </navbar>
			);
		}
		//Mobile navbar
		else {
			return(
				<div>hey</div>
			);
		}
	}
}

class MobileNav extends React.Component {
	render() {
		return(
	      	<div class="overlay-content">
		        <a href="#about" onclick="changeBurger(myBurg)">
		        	about
		        </a>
		        <a href="#faq" onclick="changeBurger(myBurg)">
		        	faq
		        </a>
		        <a href="#sponsors" onclick="changeBurger(myBurg)">
		        	sponsors
		        </a>
		        <a href="#footer" onclick="changeBurger(myBurg)">
		        	social media
		        </a>
	      	</div>
		);
	}
}

export default Navbar;
